--
-- Table structure for table `ristoranti`
--

DROP TABLE IF EXISTS `ristoranti`;
/*!40101 SET @saved_cs_client     = @@character_set_client */;
/*!50503 SET character_set_client = utf8mb4 */;
CREATE TABLE `ristoranti` (
  `id` int NOT NULL AUTO_INCREMENT COMMENT 'Identificativo univoco per ogni ristorante',
  `nome` varchar(100) NOT NULL COMMENT 'Nome del ristorante',
  `indirizzo` varchar(255) NOT NULL COMMENT 'Indirizzo fisico del ristorante',
  `citta` varchar(50) NOT NULL COMMENT 'Citt├á in cui si trova il ristorante',
  `telefono` varchar(15) NOT NULL COMMENT 'Numero di telefono del ristorante',
  `tipologia_cucina` varchar(50) NOT NULL COMMENT 'Tipologia di cucina offerta (es. Italiana, Cinese, Vegetariana)',
  `valutazione_media` decimal(3,2) DEFAULT NULL COMMENT 'Valutazione media del ristorante (scala da 1 a 5)',
  `fascia_prezzo` enum('Economico','Medio','Costoso') DEFAULT 'Medio' COMMENT 'Fascia di prezzo indicativa',
  `posti_disponibili` int NOT NULL COMMENT 'Numero di posti disponibili nel ristorante',
  `data_apertura` date NOT NULL COMMENT 'Data di apertura del ristorante',
  `orario_apertura` time NOT NULL COMMENT 'Orario di apertura giornaliera',
  `orario_chiusura` time NOT NULL COMMENT 'Orario di chiusura giornaliera',
  `data_creazione` timestamp NULL DEFAULT CURRENT_TIMESTAMP COMMENT 'Data e ora di creazione del record',
  `data_aggiornamento` timestamp NULL DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP COMMENT 'Data e ora dell''ultimo aggiornamento del record',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=2821 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_0900_ai_ci COMMENT='Tabella che memorizza le informazioni principali sui ristoranti';
/*!40101 SET character_set_client = @saved_cs_client */;

