CREATE TABLE `stanze` (
  `id` int NOT NULL AUTO_INCREMENT COMMENT 'Identificativo univoco per ogni stanza',
  `id_hotel` int NOT NULL COMMENT 'ID dell''hotel a cui appartiene la stanza (relazione con la tabella hotel)',
  `numero_stanza` varchar(10) NOT NULL COMMENT 'Numero o identificativo univoco della stanza all''interno dell''hotel',
  `tipologia` enum('Singola','Doppia','Suite') NOT NULL COMMENT 'Tipologia della stanza in base alla capacit├á e ai comfort',
  `prezzo` decimal(10,2) NOT NULL COMMENT 'Prezzo per notte della stanza',
  `stato` enum('Libera','Occupata','Manutenzione') NOT NULL DEFAULT 'Libera' COMMENT 'Stato attuale della stanza',
  `vista` enum('Mare','Montagna','Citt├á','Interno') DEFAULT 'Interno' COMMENT 'Vista della stanza, se applicabile',
  `data_ultima_pulizia` date DEFAULT NULL COMMENT 'Data dell''ultima pulizia effettuata nella stanza',
  PRIMARY KEY (`id`),
  KEY `fk_hotel_stanze` (`id_hotel`),
  CONSTRAINT `fk_hotel_stanze` FOREIGN KEY (`id_hotel`) REFERENCES `hotel` (`id`) ON DELETE CASCADE ON UPDATE CASCADE
) ENGINE=InnoDB AUTO_INCREMENT=6116 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_0900_ai_ci COMMENT='Tabella che memorizza le informazioni delle stanze degli hotel e il loro stato';
