DROP TABLE IF EXISTS `veicoli_noleggio`;
/*!40101 SET @saved_cs_client     = @@character_set_client */;
/*!50503 SET character_set_client = utf8mb4 */;
CREATE TABLE `veicoli_noleggio` (
  `id` int NOT NULL AUTO_INCREMENT COMMENT 'Identificativo univoco per ogni veicolo',
  `modello` varchar(50) NOT NULL COMMENT 'Modello del veicolo, ad esempio Fiat Panda, Tesla Model 3',
  `marca` varchar(50) NOT NULL COMMENT 'Marca del veicolo, ad esempio Fiat, Tesla',
  `anno` int NOT NULL COMMENT 'Anno di immatricolazione del veicolo',
  `targa` varchar(10) NOT NULL COMMENT 'Targa del veicolo, un identificativo unico',
  `tipo` varchar(20) NOT NULL COMMENT 'Tipo di veicolo, ad esempio Auto, Moto, Furgone',
  `chilometraggio` int NOT NULL DEFAULT '0' COMMENT 'Chilometraggio totale del veicolo',
  `carburante` enum('Benzina','Diesel','Elettrico','Ibrido') NOT NULL COMMENT 'Tipo di carburante utilizzato dal veicolo',
  `disponibilita` tinyint(1) NOT NULL DEFAULT '1' COMMENT 'Disponibilit├á del veicolo: TRUE=Disponibile, FALSE=Noleggiato',
  `prezzo_giornaliero` decimal(10,2) NOT NULL COMMENT 'Prezzo giornaliero per il noleggio del veicolo',
  `data_ultima_manutenzione` date DEFAULT NULL COMMENT 'Data dell''ultima manutenzione effettuata sul veicolo',
  PRIMARY KEY (`id`),
  UNIQUE KEY `targa` (`targa`)
) ENGINE=InnoDB AUTO_INCREMENT=292 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_0900_ai_ci COMMENT='Tabella che contiene i dati relativi ai veicoli disponibili per il noleggio';
