--
-- Table structure for table `voli`
--

DROP TABLE IF EXISTS `voli`;
/*!40101 SET @saved_cs_client     = @@character_set_client */;
/*!50503 SET character_set_client = utf8mb4 */;
CREATE TABLE `voli` (
  `id` int NOT NULL AUTO_INCREMENT COMMENT 'Identificativo univoco del volo',
  `partenza` varchar(5) NOT NULL COMMENT 'Codice dell''aeroporto di partenza',
  `destinazione` varchar(5) NOT NULL COMMENT 'Codice IATA dell''aeroporto di destinazione (esempio: Roma Fiumicino - FCO)',
  `data` datetime NOT NULL COMMENT 'Data e orario di partenza del volo (formato: YYYY-MM-DD HH:MM:SS)',
  `durata` int DEFAULT NULL COMMENT 'Durata del volo in minuti',
  `codice_volo` varchar(10) NOT NULL COMMENT 'Codice identificativo del volo',
  `fascia_oraria` enum('Mattina','Pomeriggio','Sera','Notte') DEFAULT NULL COMMENT 'Fascia oraria in cui il volo ├¿ programmato',
  `num_passeggeri` int DEFAULT NULL COMMENT 'Numero di passeggeri prenotati o disponibili',
  `stato_volo` enum('Programmato','Completato','Annullato','In ritardo') DEFAULT NULL COMMENT 'Stato del volo',
  `gate_partenza` varchar(10) DEFAULT NULL COMMENT 'Gate di partenza dell''aeroporto',
  `gate_destinazione` varchar(10) DEFAULT NULL COMMENT 'Gate di destinazione dell''aeroporto',
  `aereo_id` int DEFAULT NULL COMMENT 'ID dell''aereo utilizzato per il volo',
  `prezzo_base` decimal(10,2) NOT NULL COMMENT 'Prezzo base del volo, esclusi eventuali extra o tasse',
  `prezzo_biglietto` decimal(10,2) NOT NULL COMMENT 'Prezzo finale del biglietto, comprensivo di tasse e supplementi',
  PRIMARY KEY (`id`),
  KEY `fk_aereo_id` (`aereo_id`),
  CONSTRAINT `fk_aereo_id` FOREIGN KEY (`aereo_id`) REFERENCES `aerei` (`id`) ON DELETE SET NULL ON UPDATE CASCADE
) ENGINE=InnoDB AUTO_INCREMENT=17560 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_0900_ai_ci COMMENT='Tabella che memorizza i voli programmati tra due destinazioni, con dettagli aggiuntivi come orario, durata, stato, e numero di passeggeri';
/*!40101 SET character_set_client = @saved_cs_client */;

